import './choose.css';
import React from 'react';
import logo from './img/IUAlogo.png';
import { BrowserRouter as Router,Link } from 'react-router-dom';//BrowserRouter
import { Routes ,Route, useNavigate } from 'react-router-dom';

const Choose=()=> {

    let navigate = useNavigate();
    const toRent = (e) => {
        e.preventDefault();
         navigate("/rent")
      }

    const toChangeClass = (e) => {
        e.preventDefault();
         navigate("/changeClass")
      }

    const toFood = (e) => {
        e.preventDefault();
         navigate("/food")
      }

    function Choose() {
      return (
        <div className="Choose"> 
           <button className='chooseToRent'>租屋版</button>
           <button className='chooseToChangeClass'>換課版</button>
           <button className='chooseToFood'>美食版</button>
        </div>
      );
    }

    return (

           
                <Routes>
                    <Route path="/" element={<Choose />} />
                </Routes>
             
    );
}

export default Choose;
